import styled from "styled-components";



export const Ul = styled.ul` 

    display: flex;
    justify-content: center;
    margin: 10px 0 20px 0;


    li{
        margin-right: 2px;
        list-style: none;
    }

    li button{
        border: none;
        background-color: #f1008e;
        padding: 20px;
        border-radius: 999px;
        color: #fff;
        font-size: 2em;
    }

`
